class Prices extends React.Component {
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div>
                <ul className="list-group">
                    <li className="list-group-item">
                        Bitcoin rate for {this.props.bpi.USD.description}:
                        <span  className="badge">{this.props.bpi.USD.code}</span>
                        <strong>{parseFloat(this.props.bpi.bpi.USD.rate).toFixed(2)}</strong>
                    </li>

                </ul>
            </div>
        )
    }
}

export default Prices;
